INSERT INTO Books VALUES(null, "Edmund De Waal", "The hare with amber eyes", "264 wood and ivory carvings, none of them bigger than a matchbox...", "264 wood and ivory carvings, none of them bigger than a matchbox: Edmund de Waal was entranced when he first encountered the collection in his great uncle Iggie's Tokyo apartment. When he later inherited the 'netsuke', they unlocked a story far larger and more dramatic than he could ever have imagined.", 30, 50, 30, 1, "img/content/preview/the-hare-with-amber-eyes.jpg", "img/content/full/the-hare-with-amber-eyes.jpg");
INSERT INTO Books VALUES(null, "Steven Pressfield", "The var of Art", "To begin Book One, Pressfield labels the enemy of creativity Resistance...", "To begin Book One, Pressfield labels the enemy of creativity Resistance, his all-encompassing term for what Freud called the Death Wish—that destructive force inside human nature that rises whenever we consider a tough, long-term course of action that might do for us or others something that’s actually good", 75, 60, 0, 2, "img/content/preview/the-war-of-art.jpg", "img/content/full/the-war-of-art.jpg");
INSERT INTO Books VALUES(null, "Ravinder Singh", "Can love happen twice?", "When Ravin first said ‘I love you . . .’ he meant it forever...", "When Ravin first said ‘I love you . . .’ he meant it forever. The world has known this through Ravin’s bestselling novel, I Too Had a Love Story. But did Ravin’s story really end on the last page of that book?", 40, 25, 30, 1, "img/content/preview/can-love-happen-twice.jpg", "img/content/full/can-love-happen-twice.jpg");
INSERT INTO Books VALUES(null, "Amish", "The Immortals of Meluha", "The story is gripping and well-paced. An essentially mythological story written in a modern style...", "The story is gripping and well-paced. An essentially mythological story written in a modern style, the novel creates anticipation in the readers mind and compels one to read with great curiosity till the end.", 2, 80, 0, 1, "img/content/preview/meluha.jpg", "img/content/full/meluha.jpg");
INSERT INTO Books VALUES(null, "Presit Blendy", "Life Is What You Make It", "Life Is What You Make It is a novel by Preeti Shenoy. The book was in “Top books of 2011” as per the...", "Life Is What You Make It is a novel by Preeti Shenoy. The book was in “Top books of 2011” as per the Nielsen list which is published in Hindustan Times. It was also on Times of India all-time best sellers of 2011. This is an astonishing love story set in India in 1990s", 80, 200, 0, 3, "img/content/preview/life-is-what-you-make-it.jpg", "img/content/full/life-is-what-you-make-it.jpg");
INSERT INTO Books VALUES(null, "Girish Kenly", "Marathon Baba", "He runs through his country for seven long years until he miraculously turns red and builds Marathon Ashram...", "He runs through his country for seven long years until he miraculously turns red and builds Marathon Ashram. Hundreds of runaways descend on the Ashram and become its residents. ", 21, 200, 0, 1, "img/content/preview/marathon-baba.jpg", "img/content/full/marathon-baba.jpg");
INSERT INTO Books VALUES(null, "John Grisham", "Calico Joe", "It began quietly enough with a pulled hamstring. The first baseman for the Cubs AAA affiliate in Wichita went down as he rounded third and headed for home...", "It began quietly enough with a pulled hamstring. The first baseman for the Cubs AAA affiliate in Wichita went down as he rounded third and headed for home. The next day, Jim Hickman, the first baseman for the Cubs, injured his back.", 72, 150, 0, 4, "img/content/preview/calico-joe.jpg", "img/content/full/calico-joe.jpg");
INSERT INTO Books VALUES(null, "Douglas Adams", "The long dark tea-time of the soul", "When a passenger check-in desk at London's Heathrow Airport disappears in a ball of orange flame...", "When a passenger check-in desk at London's Heathrow Airport disappears in a ball of orange flame, the explosion is deemed an act of God. But which god, wonders holistic detective Dirk Gently?", 2, 100, 30, 8, "img/content/preview/the-long-dark.jpg", "img/content/full/the-long-dark.jpg");
INSERT INTO Books VALUES(null, "George R.R. Martin", "The armageddon rag", "Onetime underground journalist Sandy Blair has come a long way from his radical roots in...", "Onetime underground journalist Sandy Blair has come a long way from his radical roots in the ’60s—until something unexpectedly draws him back: the bizarre and brutal murder of a rock promoter who made millions.", 26, 152, 0, 7, "img/content/preview/the-armageddon-rag.jpg", "img/content/full/the-armageddon-rag.jpg");
INSERT INTO Books VALUES(null, "Corina Edison", "A walk a cross the sun", "When a tsunami rages through their village in India, Ahalya Ghai and her sister Sita are left...", "When a tsunami rages through their village in India, Ahalya Ghai and her sister Sita are left orphaned and homeless. As they struggle to reach the convent where they attend school.", 15, 200, 0, 1, "img/content/preview/a-walk-across-the-sun.jpg", "img/content/full/a-walk-across-the-sun.jpg");
INSERT INTO Books VALUES(null, "Jefrey Archer", "The sins of the father", "Harry Clifton has joined the British Navy and has assumed the identity of Tom Bradshaw after his ship sinks in...", "Harry Clifton has joined the British Navy and has assumed the identity of Tom Bradshaw after his ship sinks in order to solve some of his problems, never knowing that he will end up in prison.", 15, 220, 0, 1, "img/content/preview/the-sins-of-the-father.jpg", "img/content/full/the-sins-of-the-father.jpg");
INSERT INTO Books VALUES(null, "Rhonda Byrne", "The magic", "When I first sit down to write a book, the creation begins as a joyful yet solitary one...", "When I first sit down to write a book, the creation begins as a joyful yet solitary one; there is just the Universe and me. Then, gradually, the circle begins to widen", 72, 10, 0, 1, "img/content/preview/the-magic.jpg", "img/content/full/the-magic.jpg");
INSERT INTO Books VALUES(null, "Cross Roads", "Urban Shots", "Edited by bestselling author, Ahmed Faiyaz, this anthology explores the conflict...", "Edited by bestselling author, Ahmed Faiyaz, this anthology explores the conflict, chaos and confusion in the lives of interesting and colourful characters in Urban India.The reclusive kid with a beautiful bicycle; a migrant to Mumbai with Old Monk on his breath, trying to get off a Virar Fast at Borivali; ", 12, 22, 0, 9, "img/content/preview/urban-shots.jpg", "img/content/full/urban-shots.jpg");
INSERT INTO Books VALUES(null, "Rick Smolan", "The human face of big data", "The images and stories captured in The Human Face of Big Data are the result of an extraordinary artistic...", "The images and stories captured in The Human Face of Big Data are the result of an extraordinary artistic, technical, and logistical juggling act aimed at capturing the human face of the Big Data Revolution.", 97, 300, 0, 1, "img/content/preview/meluha.jpg", "img/content/full/meluha.jpg");
INSERT INTO Books VALUES(null, "Kaplana Swamnathan", "I never knew it was you", "Sita, detective Lalli’s niece—and occasional Watson—runs into former classmate Anais at Mumbai airport...", "Sita, detective Lalli’s niece—and occasional Watson—runs into former classmate Anais at Mumbai airport. Even as the friends catch up, Anais hands over a cardboard box she is carrying to a waiting woman, nonchalantly informing the traumatized lady that the box contains her son’s ashes.", 20, 205, 0, 6, "img/content/preview/i-never-knew-it-was-you.jpg", "img/content/full/i-never-knew-it-was-you.jpg");
INSERT INTO Books VALUES(null, "Michael Batty", "Essential Engineering Mathematics", "This textbook covers topics such as functions, single variable calculus...", "This textbook covers topics such as functions, single variable calculus, multivariate calculus, differential equations and complex functions.", 75, 120, 20, 5, "img/content/preview/life-is-what-you-make-it.jpg", "img/content/full/life-is-what-you-make-it.jpg");
INSERT INTO Books VALUES(null, "Kathleen Jamie", "Surfacing", "[Kathleen Jamie’s] essays guide you softly along coastlines of varying continents...", "[Kathleen Jamie’s] essays guide you softly along coastlines of varying continents, exploring caves, and pondering ice ages until the narrator stumbles over — not a rock on the trail, but mortality, maybe the earth’s, maybe our own, pointing to new paths forward through the forest.", 28, 101, 0, 8, "img/content/preview/urban-shots.jpg", "img/content/full/urban-shots.jpg");
